   ELEMENTAL FUNCTION ONUMM30N2_TAN(X) RESULT(RES)

      TYPE(ONUMM30N2), INTENT(IN) :: X
      REAL(DP) :: DER0,DER1,DER2
      TYPE(ONUMM30N2) :: RES
      
      DER0 = TAN(X%R)
      DER1 = TAN(X%R)**2 + 1
      DER2 = 2*(TAN(X%R)**2 + 1)*TAN(X%R)

      RES = FEVAL(X,DER0,DER1,DER2)

   END FUNCTION ONUMM30N2_TAN

   ELEMENTAL FUNCTION ONUMM30N2_COS(X) RESULT(RES)

      TYPE(ONUMM30N2), INTENT(IN) :: X
      REAL(DP) :: DER0,DER1,DER2
      TYPE(ONUMM30N2) :: RES
      
      DER0 = COS(X%R)
      DER1 = -SIN(X%R)
      DER2 = -COS(X%R)

      RES = FEVAL(X,DER0,DER1,DER2)

   END FUNCTION ONUMM30N2_COS

   ELEMENTAL FUNCTION ONUMM30N2_SIN(X) RESULT(RES)

      TYPE(ONUMM30N2), INTENT(IN) :: X
      REAL(DP) :: DER0,DER1,DER2
      TYPE(ONUMM30N2) :: RES
      
      DER0 = SIN(X%R)
      DER1 = COS(X%R)
      DER2 = -SIN(X%R)

      RES = FEVAL(X,DER0,DER1,DER2)

   END FUNCTION ONUMM30N2_SIN

   ELEMENTAL FUNCTION ONUMM30N2_ATAN(X) RESULT(RES)

      TYPE(ONUMM30N2), INTENT(IN) :: X
      REAL(DP) :: DER0,DER1,DER2
      TYPE(ONUMM30N2) :: RES
      
      DER0 = ATAN(X%R)
      DER1 = 1D0/(X%R**2 + 1)
      DER2 = -2*X%R/(X%R**2 + 1)**2

      RES = FEVAL(X,DER0,DER1,DER2)

   END FUNCTION ONUMM30N2_ATAN

   ELEMENTAL FUNCTION ONUMM30N2_ACOS(X) RESULT(RES)

      TYPE(ONUMM30N2), INTENT(IN) :: X
      REAL(DP) :: DER0,DER1,DER2
      TYPE(ONUMM30N2) :: RES
      
      DER0 = ACOS(X%R)
      DER1 = -1/SQRT(1 - X%R**2)
      DER2 = -X%R/(1 - X%R**2)**(3.0D0/2.0D0)

      RES = FEVAL(X,DER0,DER1,DER2)

   END FUNCTION ONUMM30N2_ACOS

   ELEMENTAL FUNCTION ONUMM30N2_ASIN(X) RESULT(RES)

      TYPE(ONUMM30N2), INTENT(IN) :: X
      REAL(DP) :: DER0,DER1,DER2
      TYPE(ONUMM30N2) :: RES
      
      DER0 = ASIN(X%R)
      DER1 = 1/SQRT(1 - X%R**2)
      DER2 = X%R/(1 - X%R**2)**(3.0D0/2.0D0)

      RES = FEVAL(X,DER0,DER1,DER2)

   END FUNCTION ONUMM30N2_ASIN

   ELEMENTAL FUNCTION ONUMM30N2_TANH(X) RESULT(RES)

      TYPE(ONUMM30N2), INTENT(IN) :: X
      REAL(DP) :: DER0,DER1,DER2
      TYPE(ONUMM30N2) :: RES
      
      DER0 = TANH(X%R)
